            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Rahul',
            imgurl: Rahul,
            Companyname: 'MicroSoft',
            packages: '43.3',
            duration: '2016-20'
        }, {
            name: 'Taranjeet Kaur',
            imgurl: top2,
            Companyname: 'Adobe',
            packages: '43.17',
            duration: '2016-20'
        }, {
            name: 'Riya Verma',
            imgurl: top3,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Himakshi Salhotra',
            imgurl: top4,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Rahul',
            imgurl: Rahul,
            Companyname: 'MicroSoft',
            packages: '43.3',
            duration: '2016-20'
        }, {
            name: 'Taranjeet Kaur',
            imgurl: top2,
            Companyname: 'Adobe',
            packages: '43.17',
            duration: '2016-20'
        }, {
            name: 'Riya Verma',
            imgurl: top3,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }, {
            name: 'Himakshi Salhotra',
            imgurl: top4,
            Companyname: 'Adobe',
            packages: '40',
            duration: '2015-19'
        }
    ]
    const [search, setSearch] = useState('');
    const [selectvalue, setSelectvalue] = useState('Search');
    const [selectvaluec, setSelectvaluec] = useState('Search by');
    const [searchopen, setSearchopen] = useState(false);
    // useEffect(() => {
    //   console.log(selectvalue);
    // }, [selectvalue])
    const [placeholderv, setPlaceholderv] = useState('Search')
    const Handlesearch = ()=>{
        if(selectvaluec === 'Company Name'){
            setPlaceholderv(selectvaluec);
            setSelectvalue('Companyname');
        }
        else if (selectvaluec === 'Year(2016-20)'){
            setPlaceholderv('Year Eg. 2016-20')
            setSelectvalue('duration');
        }
        else if (selectvaluec === 'packagess'){
            setSelectvalue('packagess');
            setPlaceholderv('Enter packpage')
        }
    }
    useEffect(() => {
       Handlesearch();
    }, [Handlesearch])
    
    return (
        <>
            <div className='flex flex-col justify-center rounded items-center w-full sm:w-[98%] mx-auto text-center shadow-md my-8'>
                <div className='flex flex-col p-2 m-2 text-center'>
                    <span className='text-3xl font-sans font-bold'>Placements </span>
                    <span className='text-lg font-mono font-semibold '> (Computer Science and Engineering)</span>
                </div>
                <div className='m-3 block w-full'>
                    <input placeholder={placeholderv} defaultValue={search} onChange={(e) => {setSearch(e.target.value) }} className='w-1/3 m-4 p-2 text-lg rounded border-2 shadow-lg border-gray-300' onClick={()=>setSearchopen(false)} />
                    <button className='bg-green-600 text-lg shadow-md w-24 h-12 p-2 m-0 mb-2 text-white rounded-lg group-hover:bg-green-700 group-hover:text-base focus:ring-4 focus:ring-green-300' onClick={() => { setSearchopen(!searchopen) }}>Search</button>
                    <select className='mx-3 border-2 h-12 w-40 rounded' value={selectvaluec} onChange={(e)=>setSelectvaluec(e.target.value)}>
                        <option selected className='p-4 text-base'>Search by</option>
                        <option value='Company Name' className='p-4 text-base' >Company Name</option>
                        <option value='Year(2016-20)' className='p-4 text-base'>Year(2016-20)</option>
                        <option value='packagess' className='p-4 text-base'>packages above_</option>
                    </select>
                </div>
                <div className='grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 m-2 lg:mx-4 w-full items-center justify-center place-items-center'>
                    {
                        list.map((item, i) => {
                            return searchopen && search ? ((item.packages >= search || item.duration === search || item.Companyname === search) ? (
                                <div key={i} className='w-[85%] sm:w-full m-2  h-[21rem] flex items-center justify-center group'>
                                    <div className="flex flex-col items-center justify-center max-w-sm bg-white rounded-lg border-2  h-[19rem] border-gray-200 shadow w-[90%] lg:w-[97%] hover:h-[21rem] hover:w-full hover:absolute">
                                        <div className='text-center font-medium text-xl m-2 p-2 group-hover:text-2xl'>{item.name}</div>
                                        <div className="flex flex-col items-center pb-10">
                                            <img className="m-3 w-24 h-24 rounded-full border-gray-600 shadow-xl group-hover:w-28 group-hover:h-28" src={item.imgurl} alt="..." />
                                            <h4 className="m-1 text-xl font-medium text-gray-900 group-hover:text-2xl">{item.Companyname}</h4>
                                            <h4 className="text-lg text-gray-500 dark:text-gray-400 group-hover:text-xl">{item.packages} L.P.A</h4>
                                            <h4 className="text-lg text-gray-500 dark:text-gray-400 group-hover:text-xl">({item.duration})</h4>
                                        </div>
                                    </div>
                                </div>
                            ) : <></>) :
                                (
                                    <div key={i} className='w-[85%] sm:w-full m-2  h-[21rem] flex items-center justify-center group'>
                                        <div className="flex flex-col items-center justify-center max-w-sm bg-white rounded-lg border-2  h-[19rem] border-gray-200 shadow w-[90%] lg:w-[97%] hover:h-[21rem] hover:w-full hover:absolute">
                                            <div className='text-center font-medium text-xl m-2 p-2 group-hover:text-2xl'>{item.name}</div>
                                            <div className="flex flex-col items-center pb-10">
                                                <img className="m-3 w-24 h-24 rounded-full border-gray-600 shadow-xl group-hover:w-28 group-hover:h-28" src={item.imgurl} alt="..." />
                                                <h4 className="m-1 text-xl font-medium text-gray-900 group-hover:text-2xl">{item.Companyname}</h4>
                                                <h4 className="text-lg text-gray-500 dark:text-gray-400 group-hover:text-xl">{item.packages} L.P.A</h4>
                                                <h4 className="text-lg text-gray-500 dark:text-gray-400 group-hover:text-xl">({item.duration})</h4>
                                            </div>
                                        </div>
                                    </div>
                                )
                        })
                    }
                </div>
            </div>
        </>
    )
}

export default AllPlacement
